
const log = console.log

function print_pdf() {
    var pdf = new jsPDF('p', 'pt', 'letter');
    pdf.addHTML(document.body, function () {
        pdf.save('result.pdf');
    });
}

function calc() {
    
    // rounded float 
    var rounded = function (number, kl) {
        return +number.toFixed(kl);
    }

    // get values input
    var C5 = parseFloat($('#var-d').val());
    var C6 = parseFloat($('#var-cv').val());
    var C7 = parseFloat($('#var-uv').val());
    var C9 = 0

    // formula calculation
    if (C7 < 60) {
        C9 = 3.14 / 4 * (C7 / 100.0) ** 2
    } else {
        C9 = 1.781 - 0.933 * Math.log10(100 - C7)
    }


    const C11 = C9 * C5 ** 2 / C6
    const C12 = C11 / 30.4167
    const C13 = C12 / 12
    
    // set result cal
    $('#var-Tv').text(rounded(C9, 3))
    $('#var-days').text(rounded(C11, 0))
    $('#var-months').text(rounded(C12, 1))
    $('#var-years').text(rounded(C13, 3))
};

